import React, { useState } from 'react';
import axios from 'axios';

const App = () => {
  const [input, setInput] = useState('');
  const [response, setResponse] = useState(null);
  const [selectedFilter, setSelectedFilter] = useState('all');

  const handleInputChange = (event) => {
    setInput(event.target.value);
  };

  const handleSubmit = async () => {
    try {
      const json = JSON.parse(input);
      const res = await axios.post('https://your-backend-url/bfhl', json);
      setResponse(res.data);
    } catch (error) {
      console.error("Invalid JSON or API error:", error);
      setResponse(null);
    }
  };

  const renderResponse = () => {
    if (!response) return null;

    const data = {
      numbers: selectedFilter === 'all' || selectedFilter === 'numbers' ? response.numbers : [],
      alphabets: selectedFilter === 'all' || selectedFilter === 'alphabets' ? response.alphabets : [],
      highest_alphabet: selectedFilter === 'all' || selectedFilter === 'highest_alphabet' ? response.highest_alphabet : [],
    };

    return (
      <pre>{JSON.stringify(data, null, 2)}</pre>
    );
  };

  return (
    <div>
      <h1>Your Roll Number</h1>
      <textarea
        rows="5"
        cols="50"
        value={input}
        onChange={handleInputChange}
        placeholder='Enter JSON here...'
      />
      <button onClick={handleSubmit}>Submit</button>
      {response && (
        <div>
          <label>
            Filter:
            <select onChange={(e) => setSelectedFilter(e.target.value)} value={selectedFilter}>
              <option value="all">All</option>
              <option value="numbers">Numbers</option>
              <option value="alphabets">Alphabets</option>
              <option value="highest_alphabet">Highest Alphabet</option>
            </select>
          </label>
          {renderResponse()}
        </div>
      )}
    </div>
  );
};

export default App;
